import React from "react";


const Contact = () => {



    return (
        <div className="contact-wrapper">
            <div className="contact">
                <h3>Contact</h3>
                <div className="links">
                    <p>Email:</p>
                    <a href="mailto:DavidJHennig@gmail.com">Send an email</a>
                    {/* <br /> */}
                    <p>LinkedIn: </p>
                    <a target="_blank" rel="noopener noreferrer" href="https://www.linkedin.com/in/davidhennig/">Connect on LinkedIn</a>
                    {/* <br /> */}
                    <p>Github: </p>
                    <a target="_blank" rel="noopener noreferrer" href="https://github.com/davidhennig">View my Github repositories</a>
                </div>
            </div>
        </div>
    )
}

export default Contact;
